import SnakeGame from "./SnakeGame/SnakeGame";

interface StartProps {
    // setStart: React.Dispatch<React.SetStateAction<boolean>>;
    // setStart: Function;
    setGame: Function;
    // selectGame: Function;
}

const StartMenu = (props : StartProps) => {

    interface ButtonThis {
        // onClick: Function;
        // value: string;
    }

    const gameStart = () => {
        // console.log(e);
        props.setGame({game: "snake"});
        // props.setStart({start: true});
    };
    const selectGame = (game: string) => {
        switch(game) {
            case "snake":
                return <SnakeGame />
            case "menu":
                return <StartMenu setGame={() => setGame} game={game}/>
        }
    }

    return (
        <>
            <h1>Game</h1>
            <label>SnakeGame{'  '}<button value="snake" onClick={() => gameStart()} >Start</button></label>

        </>
    );
};

export default StartMenu;
